import React from 'react';
import s from "./TaskButtons.module.css";
import {AddTaskButtons} from "../../../Common/FormButton";

const TaskButtons = (props) => {

    return (<div>
{/*            <div>
                <button className={s.add} onClick={props.addNewTask}>Add Task</button>
            </div>*/}
            <div>
                <AddTaskButtons onClick={props.onNameSort} text={"Сортировать по имени"} />
            </div>
            <div>
                <AddTaskButtons onClick={props.onPrioritySort} text={"Сортировать по приоритету"} />
            </div>
        </div>
    );
};

export default TaskButtons;
